    }
    const NavStyle = {
        marginTop: "10px",
        display: "flex"
    }
    const logoStyle = {
        fontSize: '0.8em'
    }
    return (
        <footer>
            <style jsx>{
                `
                footer{
        background: "#FFF",
        text-align: "center",
